-- Table transactions as T {
--   id uuid [pk]
--   reference_id uuid [not null]
--   type varchar [not null]
--   created_at timestamptz [not null, default: `now()`]// includes timezone
--   updated_at timestamptz [not null, default: `now()`]// includes timezone
-- }

CREATE EXTENSION IF NOT EXISTS "uuid-ossp";

CREATE TABLE transactions (
    reference_id uuid DEFAULT uuid_generate_v4(),
    type uuid DEFAULT uuid_generate_v4(),
    created_at timestamptz  DEFAULT CURRENT_TIMESTAMP NOT NULL,
    updated_at timestamptz DEFAULT CURRENT_TIMESTAMP NOT NULL
);

-- CREATE INDEX transactions_created_at_idx
-- ON transactions (created_at);

-- CREATE INDEX transactions_updated_at_idx
-- ON transactions (updated_at);

SELECT create_hypertable('transactions','created_at');

INSERT INTO transactions (created_at, updated_at) SELECT i::timestamptz, i::timestamptz from generate_series('2015-01-01','2022-01-01', INTERVAL '1 minute') AS t(i);

